class Solution:
    def validPalindrome(self, s: str) -> bool:
        isPalindrome = False
        ss = s[::-1]
        if s == ss:
            isPalindrome = True
        else:
            for i in range(len(s)):
                # print("s: "+ s[0:i:]+s[i+1::]+", ss: "+ss[0:len(ss)-i-1]+ss[len(ss)-i-1+1::])
                if s[0:i:]+s[i+1::] == ss[0:len(ss)-i-1]+ss[len(ss)-i-1+1::]:
                    isPalindrome = True
                    break
                else:
                    continue
        print(isPalindrome)
        return isPalindrome
        

